    useEffect(() => {
      console.log('Productos recibidos:', products);
    }, [products]);
  
    return (
      <div className="product-list">
        {products.map((product) => (
          <ProductCard
            key={product._id}
            image={product.image}
            name={product.name}
            price={`$${product.price}`}
            category={product.category}
          />
        ))}
      </div>
